axios.defaults.withCredentials = true;

const random_bullshit = {
    withCredentials: true,
    headers: {'Access-Control-Allow-Origin': 'http://localhost:3000', 'Content-Type': 'application/json'
}};
  
export const fetchEmps = () => pass;
export const createEmp = (newEmp) => pass; 
export const deleteEmp = (id) => pass;


export const register = (formData) => API.post('auth/register', formData, random_bullshit);
export const login = (formData) => API.post('auth/login', formData);
